import axios from 'axios';

const api = axios.create({
  baseURL: 'http://localhost:3333',
  headers: {
    'Content-Type': 'application/json',
  },
})


api.interceptors.request.use(()=> {
  const token = store.getState().session.token;

});

export default api;
